bizagi.rendering.basicUserField.extend("bizagi.rendering.LeafletMaps",{}, {

    /*************************************************************/
    /* methods to be overriden by the implementations            */
    /*************************************************************/
    getEditableControl: function () {
        //standard initialization
        var self = this;
        var properties = self.properties;

        self.myDiv = $("<div>");
        self.myDiv.addClass("PinOnMap_MainDivClass");
        
        if (self.getMode() == "execution")
        {
            var divMap = $("<div id='pinOnMap' class='PinOnMap'>");
            self.myDiv.append(divMap);
        }
        else
        {
            var imgDesign = $("<img style='width:100%;' src='data:image/jpeg;base64,'>");
            self.myDiv.append(imgDesign);
        }

        return self.myDiv;
    },
    
    getReadonlyControl: function () {
         var self = this;
         var properties = self.properties;

        self.myDiv = $("<div>");
        self.myDiv.addClass("PinOnMap_MainDivClass");
        
        if (self.getMode() == "execution")
        {
            var divMap = $("<div id='pinOnMap' class='PinOnMap'>");
            self.myDiv.append(divMap);
        }
        else
        {
            var imgDesign = $("<img style='width:100%;' src='data:image/jpeg;base64,'>");
            self.myDiv.append(imgDesign);
        }

        return self.myDiv;
    },
    getEditableValue: function() {
        var self = this;
        
         var stringData = getFinalData();

        if (stringData != undefined && stringData != "")
            return stringData;
            
		return "{}";
    },    
    setEditableValue: function(value) {

        var self = this;
        self.properties.value = value; 
    },    
    
    renderComplex: function(){
    
        var self = this;
        var properties = self.properties;
        var googleMapsKey = properties.mapboxToken || "pk.eyJ1IjoibmVwZXJ6IiwiYSI6ImNqc3V1YnVkYzAwN3M0OW56aWcwNTY2Y2EifQ.8XCOcP2ql8vCzYQDqcy-LQ";

        if (self.getMode() == "execution")
        {   
    
            var editableMap = properties.editable == undefined ? true : properties.editable;
    
            var dataLocations = properties.value  || "{}";
    
            var objLocations = JSON.parse(dataLocations);
           
            initializeVariables(objLocations,editableMap, googleMapsKey);
    
    initMap();
	
   
        }
    }

});